import React from 'react';
import { motion } from 'framer-motion';
import { Clock, Users, Target, Award } from 'lucide-react';
import './CurrentResearch.css';

const CurrentResearch = () => {
  const currentProjects = [
    {
      title: 'Advanced Machine Learning Applications',
      description: 'Developing novel machine learning algorithms for [specific application] with focus on improving accuracy and efficiency.',
      status: 'Active',
      duration: '2023 - Present',
      team: '5 Researchers',
      funding: '$500,000',
      outcomes: ['3 Publications', '2 Patents', 'Industry Collaboration']
    },
    {
      title: 'Sustainable Energy Solutions',
      description: 'Investigating renewable energy technologies and their integration into existing infrastructure systems.',
      status: 'Active',
      duration: '2022 - Present',
      team: '8 Researchers',
      funding: '$750,000',
      outcomes: ['2 Publications', '1 Conference Paper', 'Government Grant']
    },
    {
      title: 'Biomedical Imaging Enhancement',
      description: 'Improving medical imaging techniques using advanced computational methods and AI-driven analysis.',
      status: 'Active',
      duration: '2023 - Present',
      team: '6 Researchers',
      funding: '$300,000',
      outcomes: ['1 Publication', 'Clinical Trial Setup', 'Industry Partnership']
    }
  ];

  const researchMetrics = [
    { icon: <Clock size={24} />, label: 'Active Projects', value: '3' },
    { icon: <Users size={24} />, label: 'Team Members', value: '19' },
    { icon: <Target size={24} />, label: 'Research Goals', value: '12' },
    { icon: <Award size={24} />, label: 'Expected Outcomes', value: '8' }
  ];

  return (
    <section className="current-research section" id="current-research">
      <div className="container">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <h2 className="section-title">Current Research</h2>
          <p className="section-subtitle">
            Ongoing projects and initiatives that are shaping the future of research in my field
          </p>
        </motion.div>

        <motion.div 
          className="research-metrics"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          viewport={{ once: true }}
        >
          {researchMetrics.map((metric, index) => (
            <div key={index} className="metric-item">
              <div className="metric-icon">{metric.icon}</div>
              <div className="metric-content">
                <div className="metric-value">{metric.value}</div>
                <div className="metric-label">{metric.label}</div>
              </div>
            </div>
          ))}
        </motion.div>

        <motion.div 
          className="projects-grid"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.4 }}
          viewport={{ once: true }}
        >
          {currentProjects.map((project, index) => (
            <motion.div
              key={index}
              className="project-card card"
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -5 }}
            >
              <div className="project-header">
                <h3>{project.title}</h3>
                <span className={`status ${project.status.toLowerCase()}`}>
                  {project.status}
                </span>
              </div>
              
              <p className="project-description">{project.description}</p>
              
              <div className="project-details">
                <div className="detail-item">
                  <span className="detail-label">Duration:</span>
                  <span className="detail-value">{project.duration}</span>
                </div>
                <div className="detail-item">
                  <span className="detail-label">Team:</span>
                  <span className="detail-value">{project.team}</span>
                </div>
                <div className="detail-item">
                  <span className="detail-label">Funding:</span>
                  <span className="detail-value">{project.funding}</span>
                </div>
              </div>
              
              <div className="project-outcomes">
                <h4>Expected Outcomes:</h4>
                <ul>
                  {project.outcomes.map((outcome, outcomeIndex) => (
                    <li key={outcomeIndex}>{outcome}</li>
                  ))}
                </ul>
              </div>
            </motion.div>
          ))}
        </motion.div>

        <motion.div 
          className="research-highlights"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.6 }}
          viewport={{ once: true }}
        >
          <div className="highlights-content">
            <h3>Research Highlights</h3>
            <div className="highlights-grid">
              <div className="highlight-item">
                <h4>Innovation Focus</h4>
                <p>All current projects emphasize innovative approaches and cutting-edge methodologies to address complex challenges.</p>
              </div>
              <div className="highlight-item">
                <h4>Collaborative Approach</h4>
                <p>Working with interdisciplinary teams and industry partners to ensure research has real-world impact.</p>
              </div>
              <div className="highlight-item">
                <h4>Sustainability</h4>
                <p>Research initiatives are designed with long-term sustainability and scalability in mind.</p>
              </div>
            </div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default CurrentResearch;
